import React, { useState, useEffect } from 'react';
import { 
  PlayIcon, 
  StopIcon, 
  CheckCircleIcon,
  XCircleIcon,
  ExclamationTriangleIcon,
  LockClosedIcon,
  LockOpenIcon,
  ClockIcon,
  CalendarDaysIcon,
  UserGroupIcon,
  MapPinIcon,
  AcademicCapIcon,
  SunIcon,
  MoonIcon
} from '@heroicons/react/24/outline';
import axios from 'axios';
import toast from 'react-hot-toast';

function Sessions() {
  const [sessions, setSessions] = useState([]);
  const [allSchedules, setAllSchedules] = useState([]);
  const [todaysSchedule, setTodaysSchedule] = useState([]);
  const [instructors, setInstructors] = useState([]);
  const [rooms, setRooms] = useState([]);
  const [loading, setLoading] = useState(true);
  const [currentTime, setCurrentTime] = useState(new Date());
  const [upcomingClasses, setUpcomingClasses] = useState([]);
  const [currentOngoingClass, setCurrentOngoingClass] = useState(null);
  const [selectedDay, setSelectedDay] = useState('');
  const [selectedRoomFilter, setSelectedRoomFilter] = useState('');

  useEffect(() => {
    fetchData();
    // Set up real-time updates
    const interval = setInterval(fetchData, 30000); // Update every 30 seconds
    // Update current time every second
    const timeInterval = setInterval(() => setCurrentTime(new Date()), 1000);
    return () => {
      clearInterval(interval);
      clearInterval(timeInterval);
    };
  }, []);

  const fetchData = async () => {
    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      // Use the same unified data endpoint as the management page
      const unifiedResponse = await axios.get('http://localhost:5000/api/unified/data', { headers });
      const unifiedData = unifiedResponse.data;

      /* eslint-disable */console.log(...oo_oo(`1722130557_55_6_55_56_4`,'Unified data response:', unifiedData));

      // Extract data from unified response
      const allSchedulesData = unifiedData.schedules?.data || [];
      /* eslint-disable */console.log(...oo_oo(`1722130557_59_6_59_58_4`,'All schedules data:', allSchedulesData));
      /* eslint-disable */console.log(...oo_oo(`1722130557_60_6_60_63_4`,'Sample schedule data:', allSchedulesData[0]));
      /* eslint-disable */console.log(...oo_oo(`1722130557_61_6_61_110_4`,'Sample schedule keys:', allSchedulesData[0] ? Object.keys(allSchedulesData[0]) : 'No data'));
      setAllSchedules(allSchedulesData);

      // Filter today's schedules
      const currentDay = new Date().toLocaleDateString('en-US', { weekday: 'long' });
      const todaysSchedules = allSchedulesData.filter(schedule => schedule.DAYOFWEEK === currentDay);
      setTodaysSchedule(todaysSchedules);

      // Get instructors and rooms from unified data
