                                    <p className="text-xs text-green-600 font-medium">Currently Active</p>
                                  )}
                                </div>
                              </div>
                            );
                          })}
                        </div>
                      )}
                    </div>
                  </div>
                );
              });
            })()}
          </div>
        )}
      </div>

    </div>
  );
